import React, { useEffect, useState } from "react";
import axios from "axios";
function Doctprofile() {
    const [person, setperson] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:5000/doctor")
            .then(res => {
                setperson(res.data);
            });
    }, [])
    return (
        <div class="container">
            <table className="table" style="font-weight: bold;">
            {person.map((persons) => (

                        
                            <tbody>
                                <tr>
                                    <td>Full Name</td>
                                    <td>{persons.name}</td>
                                </tr>
                            </tbody>

            ))}
            </table>
        </div>
    );
}


export default Doctprofile;
